import React, { useState, useEffect, useContext } from "react";
import { RoutingContext, pagesMapping } from '../context/RoutingContext'
import selectedTileContext from "../context/SelectedTileContext";
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));

const Buy = () => {
    const { setPage } = useContext(RoutingContext)
    const { selectedTile } = useContext(selectedTileContext);

    const classes = useStyles();

    return (
      <form className={classes.root} noValidate autoComplete="off">
        <Grid container spacing={3}>
            <Grid item xs={12}>
                <TextField id="standard-basic" label="Standard"               fullWidth={true}
              InputProps={{
                readOnly: true,
              }}/>
            </Grid>
            <Grid item xs={12}>
                <TextField id="standard-basic2" label="Standard" />
            </Grid>
        </Grid>
      </form>
    );    

};

export default Buy;
